(function(){var loadHandler=window['sl_{D6ED4975-1042-491C-AA53-2C8DF54D660A}'];loadHandler&&loadHandler(34, '<div id="spr0_95f7932"><div id="spr1_95f7932" class="kern slide"><img id="img3_95f7932" src="data:image/png;base64," width="1280px" height="720px" alt="" style="left:0px;top:0px;"/><div id="spr3_95f7932" style="left:986.15px;top:662.674px;"><div id="spr4_95f7932"><img id="img0_95f7932" src="data:image/png;base64," width="273.75" height="48" alt="" style="left:0.06px;top:-0.065px;"/></div></div></div><div id="spr2_95f7932" class="kern slide"><div id="spr5_95f7932" style="left:142.897px;top:141.939px;"><div id="spr6_95f7932"><img id="img1_95f7932" src="data:image/jpeg;base64," width="687" height="395.25" alt="" style="left:-0.112px;top:-0.044px;"/></div></div><div id="svg0_95f7932" style="left:1078.69px;top:634px;"><svg width="168" height="38" viewBox="0 0 168 38"><path fill="#e2f0d9" d="M0,0 h167.04 v37.44 h-167.04 Z"/></svg></div><div id="spr7_95f7932" style="left:1078.69px;top:634px;"><div style="width:0px;"><span id="txt0_95f7932" class="relpos" data-width="74.242188" style="left:9.6px;top:1.933px;">Book B  </span> <span id="txt1_95f7932" class="relpos" data-width="73.511719" style="left:9.593px;top:1.933px;">Page 28</span></div></div><div id="svg1_95f7932" style="left:872px;top:136.09px;"><svg width="374" height="134" viewBox="0 0 374 134"><path fill="#e6faf7" d="M0,0 h373.73 v133.154 h-373.73 Z"/></svg></div><div id="spr8_95f7932" style="left:872px;top:136.09px;"><div style="width:0px;"><span id="txt2_95f7932" class="relpos" data-width="22.744141" style="left:9.6px;top:3.972px;">In </span> <span id="txt3_95f7932" class="relpos" data-width="89.836586" style="left:9.593px;top:3.972px;">Meiosis II</span> <span id="txt4_95f7932" class="relpos" data-width="201.753250" style="left:9.587px;top:3.972px;">, the two haploid cells</span></div><div style="width:0px;"><span id="txt5_95f7932" data-width="343.242828" style="left:9.6px;top:34.978px;">formed in Meiosis I divide again - this</span></div><div style="width:0px;"><span id="txt6_95f7932" class="relpos" data-width="185.373047" style="left:9.6px;top:65.985px;">time separating the </span> <span id="txt7_95f7932" class="relpos" data-width="162.252594" style="left:9.593px;top:65.985px;">sister chromatids</span></div><div style="width:0px;"><span id="txt8_95f7932" data-width="200.082031" style="left:9.6px;top:96.992px;">of each chromosome.</span></div></div><div id="spr9_95f7932" style="left:48px;top:55.016px;"><div style="width:0px;"><span id="txt9_95f7932" data-width="872.496094" style="left:9.6px;top:4.968px;">Similar to mitosis in that the cells undergo prophase, metaphase, anaphase</span></div><div style="width:0px;"><span id="txt10_95f7932" data-width="808.664062" style="left:9.6px;top:33.768px;">and telophase; however, we are now talking about two haploid cells.</span></div></div><div id="spr10_95f7932" style="left:57.511px;top:8.454px;"><div id="spr11_95f7932"><img id="img2_95f7932" src="data:image/png;base64," width="1104" height="39.75" alt="" style="left:-0.1px;top:0.133px;"/></div></div><div id="spr12_95f7932" style="left:118.933px;top:563.487px;"><div style="width:0px;"><span id="txt11_95f7932" data-width="599.203125" style="left:9.6px;top:2.267px;">The net result of meiosis I and II is haploid cell formation</span></div><div style="width:0px;"><span id="txt12_95f7932" data-width="534.304688" style="left:9.6px;top:31.067px;">(often gametes), which ensures the genetic code is</span></div><div style="width:0px;"><span id="txt13_95f7932" class="relpos" data-width="274.558594" style="left:9.6px;top:59.867px;">passed on, and promotes </span> <span id="txt14_95f7932" class="relpos" data-width="86.571609" style="left:9.593px;top:61.306px;">variation</span> <span id="txt15_95f7932" class="relpos" data-width="132.996094" style="left:9.587px;top:59.867px;"> in offspring.</span></div></div><div id="svg2_95f7932" style="left:872px;top:287.325px;"><svg width="374" height="102" viewBox="0 0 374 102"><path fill="#e6faf7" d="M0,0 h373.73 v101.845 h-373.73 Z"/></svg></div><div id="spr13_95f7932" style="left:872px;top:287.325px;"><div style="width:0px;"><span id="txt16_95f7932" data-width="333.425781" style="left:9.6px;top:3.972px;">The process looks much like mitosis,</span></div><div style="width:0px;"><span id="txt17_95f7932" data-width="321.893219" style="left:9.6px;top:34.978px;">but the key difference is that these</span></div><div style="width:0px;"><span id="txt18_95f7932" class="relpos" data-width="80.417969" style="left:9.6px;top:65.985px;">cells are </span> <span id="txt19_95f7932" class="relpos" data-width="70.999344" style="left:9.593px;top:65.985px;">haploid</span> <span id="txt20_95f7932" class="relpos" data-width="116.365883" style="left:9.587px;top:65.985px;">, not diploid.</span></div></div><div id="svg3_95f7932" style="left:872px;top:407.251px;"><svg width="374" height="71" viewBox="0 0 374 71"><path fill="#e6faf7" d="M0,0 h373.73 v70.536 h-373.73 Z"/></svg></div><div id="spr14_95f7932" style="left:872px;top:407.251px;"><div style="width:0px;"><span id="txt21_95f7932" class="relpos" data-width="109.492836" style="left:9.6px;top:3.972px;">By the end, </span> <span id="txt22_95f7932" class="relpos" data-width="217.159500" style="left:9.593px;top:3.972px;">four genetically unique</span></div><div style="width:0px;"><span id="txt23_95f7932" class="relpos" data-width="117.195961" style="left:9.6px;top:34.978px;">haploid cells</span> <span id="txt24_95f7932" class="relpos" data-width="231.879547" style="left:9.593px;top:34.978px;"> (gametes) are produced.</span></div></div><div id="svg4_95f7932" style="left:872px;top:495.867px;"><svg width="392" height="102" viewBox="0 0 392 102"><path fill="#e6faf7" d="M0,0 h391.467 v101.845 h-391.467 Z"/></svg></div><div id="spr15_95f7932" style="left:872px;top:495.867px;"><div style="width:0px;"><span id="txt25_95f7932" data-width="363.585266" style="left:9.6px;top:3.972px;">This ensures that each gamete carries a</span></div><div style="width:0px;"><span id="txt26_95f7932" data-width="323.022125" style="left:9.6px;top:34.978px;">distinct mix of genetic information,</span></div><div style="width:0px;"><span id="txt27_95f7932" class="relpos" data-width="102.320961" style="left:9.6px;top:65.985px;">promoting </span> <span id="txt28_95f7932" class="relpos" data-width="154.892578" style="left:9.593px;top:65.985px;">genetic diversity</span> <span id="txt29_95f7932" class="relpos" data-width="115.325516" style="left:9.587px;top:65.985px;"> in offspring.</span></div></div><div id="spr16_95f7932" style="left:1224.769px;"><div id="svg5_95f7932" style="left:5.031px;top:4.251px;"><svg width="47" height="28" viewBox="0 0 47 28"><path fill="#c00000" d="M0,0 h46.08 v27.429 h-46.08 Z"/></svg></div><div id="svg6_95f7932" style="left:0px;top:0px;"><svg width="65" height="28" viewBox="0 0 65 28"><path fill="none" d="M0,0 h64.174 v27.433 h-64.174 Z"/></svg></div><div id="spr17_95f7932"><div style="width:0px;"><span id="txt30_95f7932" data-width="42.155083" style="left:9.598px;top:2.268px;">END</span></div></div></div></div></div>', '{"s":[]}');})();